{"cells":[{"source":"<a href=\"https://www.kaggle.com/mohamedasalih/bellabeat-project?scriptVersionId=88596640\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"6cba79a4","metadata":{"papermill":{"duration":0.293842,"end_time":"2022-02-23T21:46:20.626658","exception":false,"start_time":"2022-02-23T21:46:20.332816","status":"completed"},"tags":[]},"source":["![](https://www.stableton.com/wp-content/uploads/2021/05/Bellabeat-Blog-Picture3.png)"]},{"cell_type":"markdown","id":"7ee9bc7e","metadata":{"papermill":{"duration":0.292821,"end_time":"2022-02-23T21:46:21.208411","exception":false,"start_time":"2022-02-23T21:46:20.91559","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"be9e8746","metadata":{"papermill":{"duration":0.291234,"end_time":"2022-02-23T21:46:21.78979","exception":false,"start_time":"2022-02-23T21:46:21.498556","status":"completed"},"tags":[]},"source":["## Phase 1: Ask\n","\n","Identify the Business Task : Analyze smart device usage data in order to\n","gain insight into how consumers use non-Bellabeat smart devices. Then\n","select one Bellabeat product to apply these insight to with the result\n","being better targeting of their consumers.\n","\n","Consider Key Stakeholders:\n","\n","-*Urška Sršen: Bellabeat's cofounder and Chief Creative Officer;*\n","\n","-Sando Mur: Mathematician and Beallbeat's cofounder\n","\n","-Bellebeat's Marketing Analytics Team\n","\n","The business task: Analyze smart device usage data in order to gain\n","insight into how people are already using their smart devices. Based on\n","the data, suggest high level recommendations for how these trends can\n","inform Bellabeat's marketing strategy. It is also expected of the the\n","analyst to survey general market trends in the field and to supplement\n","or expound his or her findings with additional data from other datasets.\n","\n","## Phase 2: Prepare\n","\n","The data comes from a public dataset generated by respondents to a\n","distributed survey via Amazon Mechanical Turk that took place between\n","03/12/2016 and 05/12/2016. This data set is available through Zenodo.org\n","[here]<https://zenodo.org/record/53894#.YdC9u2jMK73>. Zenodo is a\n","universal repository for sharing and preserving publications, data,\n","research, and other scholarly endeavors. The data is safely and securely\n","hosted by CERN. Zenodo, CERN, and the authors of the research are\n","reputable and reliable. There is no reason doubt the integrity or\n","credibility of the findings. The data has been made available in Kaggle\n","from Mobius. It is organized into 18 tables, mostly in long format with\n","few in wide format. These include output measurements for physical\n","activity, heart rate, sleep, and weight monitoring. The data is under\n","the Creative Commons Attribution 4.0 International License. This grants\n","license to the public to freely use the data in many ways including\n","reproducing, making technical modifications necessary for interpretation\n","or insight, and sharing the information therein.\n","\n","This dataset is fairly helpful in characterizing the users' activity\n","output measurements within limited scope. This data, by itself, however,\n","is only marginally useful in tracking behaviors and preferences for\n","gaining insight that can be translated into actionable steps to improve\n","product, customer good-will, and ultimately profits. In order to address\n","this we will discuss some of the limitations present and how we will\n","handle them. Then we will supplement this dataset with an additional\n","dataset and proceed with discussing our findings with reference to the\n","external research.\n","\n","### Limitations\n","\n","Limited number of participants:\n","\n","The description of this dataset on Zenodo and Kaggle states that there\n","are 30 participants. In fact, there are 33 unique ID's that tracked\n","activity. Even though this is barely an acceptable sample size, a much\n","larger sample size would have been desirable for more robust and\n","reliable conclusions . Moreover, every report aside from the daily\n","activity measurement tracks variables from less than 30 participants.\n","For the purposes of practice in this project, we will treat that as\n","acceptable and proceed with the analysis.\n","\n","Limited time period of measurement:\n","\n","The description of the dataset also states that it was generated by\n","respondents to a survey that spanned two months, from 03/12/2016 to\n","05/12/2016. In fact the data only shows measurements for a total of 31\n","days, starting with 04/12/2016 all the way to 05/12/2016. There is no\n","data anywhere from the month of March. This is a very short span of time\n","and while it may provide some detail, the impact of additional time will\n","be lost. As we will see later, this will prove to be very important. As\n","well we will ignore this and see what insights we can glean from this\n","short a period.\n","\n","Inconsistent technology:\n","\n","The description of this datasets also states:\" Variation between output\n","represents use of different types of Fitbit trackers and individual\n","tracking behaviors / preferences.\" In order to accurately characterize\n","user preferences, we must control for what features they are able to\n","access. For example, it may be misleading to say that given that 33\n","participants tracked activity but only 14 tracked heartrate we can\n","conclude that our clients exhibit less interest in tracking heartrate.\n","Why? Because maybe the participants that did not report heartrate owned\n","a version of the product that did not support that particular feature.\n","There is also the possibility of discrepancy between the technology\n","present in the Fitbit trackers used and that available through\n","BellaBeat's trackers. We can produce meaningful comparisons only if we\n","assume the technology is consistent. We will proceed with the assumption\n","that all of the features are available to all of the participants using\n","Fitbit and that each tracking feature is separately and voluntarily\n","tracked.\n","\n","Lack of information about respondents:\n","\n","We do not have any information on how random this sample is. This can\n","easily lead to sampling bias. For example, if all, or nearly all\n","participants show decreased activity between 9AM to 5PM on weekdays(\n","which it actually does, presumably because of sitting down at work),\n","this could be the result of a bias against customers who work swing\n","shifts, night shifts, or weekends. It is possible that not enough of\n","those customers were included in the survey for the sample to be\n","reliably representative of the population. We will assume this is a\n","random sample.\n","\n","Inclusion of males:\n","\n","Even though there is no demographic information about the Fitbit\n","participants, it is reasonable to assume that close to half of them are\n","male. This will clearly be a source of distortion for a company that\n","targets women. Even though men can make use of the device, their\n","patterns and preferences will more than likely be different. For\n","example, males will not use anything tracking a menstural cycle. We will\n","assume that the findings produced are appropriate to a target audience\n","of primarily women, even though it probably has substantial\n","male-generated influence.\n","\n","Outdated:\n","\n","This dataset was produced more than five years ago. The technology\n","sector evolves ever so rapidly. Consumer behavior evolves along with the\n","technology that is available. More recent data would have been\n","preferable.\n","\n","General suitability:\n","\n","This dataset seems to be more suitable for analyzing the performance of\n","the users, rather than revealing their patterns and preferences. It\n","provides little ground for the latter, which we will try to make the\n","most use of anyways. It lacks essential elements for the assignment of\n","giving high-level recommendations to the marketing team, such as\n","purchases, subscriptions, returns, cancellations, etc... It also lacks\n","qualitative data such as reviews, feedback, and recommendations.\n","\n","Customer details:\n","\n","There is no information about when each customer started using his or\n","her Fibit device. There is also no information about customer health\n","profile. The importance of these will become clear in the conclusion\n","when relating our findings to the external research paper.\n","\n","Product details:\n","\n","It's important for the analyst to know what the features of the product\n","are and what marketing is generally like in order to avoid recommending\n","strategies that are already in use.\n","\n","Third Party Data:\n","\n","We will proceed with the assumption that Bellabeat's customer base is\n","comparable to Fitbit's. In fact, clients can display significantly\n","different behavior in product use and responsiveness to marketing and/or\n","added features, depending in large part on the brand's equity, image,\n","and loyalty.\n","\n","Considering the above-mentioned limitations, Sršen was wise to suggest\n","the inclusion of another dataset that would add value to the one at\n","hand. For that I chose to include the data from a research paper titled\n","\"Beyond Novelty Effect: a Mixed-Methods Exploration Into the Motivation\n","for Long-term Activity Tracker Use.\"\n","\n","This paper along with its dataset and visuals are also available through\n","Zenodo. It was published in the Journal of American Medical Informatics\n","Association, which is a single-blind peer-review, online only, and Gold\n","Open Access journal. JAMIA is a respected journal with an Impact Factor\n","of 4.497 as of this writing. The paper is under the Creative Commons\n","Zero v1.0 Universal License, which dedicates the work to the public\n","domain.\n","\n","So for the deliverables of the Prepare phase these are the citations\n","from the two data sources considered:\n","\n","1)Furberg, R., Brinton, J., Keating, M., & Ortiz, A. (2016).\n","Crowd-sourced Fitbit datasets 03.12.2016-05.12.2016 [Data set]. Zenodo.\n","<https://doi.org/10.5281/zenodo.53894>\n","\n","2)Shin, Grace, Feng, Yuanyuan, Jarrahi, Mohammad Hossein, & Gafinowitz,\n","Nicci. (2018). Data from: Beyond novelty effect: a mixed-methods\n","exploration into the motivation for long-term activity tracker use [Data\n","set]. <https://doi.org/10.5061/dryad.f3b04rm>\n","\n","## Phase 3: Process\n","\n","I will be using R for data cleaning, transforming, wrangling, and\n","visualization. The Documentation of the these processes is available in\n","the code herein. The Fitbit dataset includes 18 separate tables from\n","which we can wrangle and visualize. Each of them is unique and will\n","require separate treatment. It is easier for my colleagues and\n","collaborators to follow the code when the tables are processed one at a\n","time, instead of doing all the cleaning and transformation first and\n","then returning to each table separately for analysis and visualization.\n","I will be aggregating the insightful visuals and conclusions in the\n","Share and Act phases of the project.\n","\n","## Phase 4: Analyze\n","\n","Before honing in on useful data,let's briefly discuss what we will\n","avoid analyzing and justify that.\n","\n","1)  We will avoid measuring the performance of participants as an end in\n","    and of itself. For example, conclusions like:\"More daily steps are\n","    highly correlated with more Active minutes,\" or \"More active minutes\n","    are highly correlated more calories burned,\" or \"The Data shows most\n","    of our clients are moderately active and that they are mostly\n","    sedentary during normal work hours.\" We will avoid this because it\n","    does not give any valuable insight or recommendations.\n","2)  We will also avoid an analysis that will lead to suggesting timing\n","    of ads or notifications to improve user performance such as\n","    prompting them to take more steps to burn more calories, for\n","    example, or to go to sleep earlier and to choose the right timing\n","    for all of that and the like. This type of analysis would be useful\n","    for improving the user experience and perhaps responsiveness to ads.\n","    However, it is likely that such features already exist. There is,\n","    for instance, already an inactivity alarm in the Bellabeat App.\n","    Also, these are suggestions to improve features of the app, not\n","    really high level recommendations to the marketing team. More\n","    importantly, this narrowly focused approach misses the larger\n","    picture of the root causes of long term customer engagement with\n","    wearable tracking devices at a high level. This is because it\n","    overlooks a more important consideration: How much are the customers\n","    really engaged with the brand? If your customer is not engaged with\n","    the product, she will not even see any notifications or\n","    advertisements.There is a much more compelling story behind the data.\n","\n","### The Novelty Effect \n","\n","The Novelty Effect is defined as \"a person's subjective 'first responses\n","to [using] a technology, not the pattern of usage that will persist over\n","time as the product ceases to be new, to him or her.' \" (Shin, et. al).\n","It is a period of time when the customer is initially excited and\n","curious about the data and the technology of the product. During this\n","period the customer is avidly engaged with the product. Beyond that, it\n","has been observed that the Novelty Effect wears off and the customers\n","overwhelmingly discontinue using their devices (Shin, et. al). A loss of\n","interest in the informational and technological aspects, as well as an\n","awareness of the persistence of each user's unique personal\n","circumstances, such as time constraints, begin to emerge and lead to\n","significant abandonment of product use (Shin, et. al). To substantiate\n","this, the authors of Beyond Novelty Effect cited other studies in their\n","introduction: \" Despite the increasing perceived value of activity\n","tracking technology, a survey of activity tracker users in the U.S.\n","showed that over half of the users had discontinued using their devices\n","and one-third of users had discontinued within 6 months.(Ledger D ,\n","McCaffrey D. Endeavour Partners Report: inside wearables: how the\n","science of human behavior change offers the secret to long-term\n","engagement. 2014.) Such short term (i.e. \\<6 months) use is unlikely to\n","bring about the sustained healthy lifestyle promised by the designers\n","and marketers of activity trackers... Shih et al.'s(Shih PC , Han K,\n","Poole ES, et al. . Use and adoption challenges of wearable activity\n","trackers. Proc iConference 2015.\n","<https://www.ideals.illinois.edu/handle/2142/73649>. Accessed December\n","29, 2017.) 6-week study with 26 users based on Fitbit logs and survey\n","shows that half of the participants abandoned Fitbit after 2 weeks.\n","Similarly, Gouveia et al.17 analyzed the usage data of their health\n","tracking prototype (named as Habito) and found that only 97 adopters out\n","of 256 users used the tracker for more than a week. These research\n","results illustrate that short-lived use and low user adoption are major\n","issues for activity tracking technology.\" The paper went on to explore\n","the impact of the Novelty effect in early adopters and the factors that\n","motivate extended activity tracker use beyond the novelty period. Their\n","data was collected from 23 participants who shared data from a range of\n","69 to 1073 days. Interestingly, 16 of the participants were female. They\n","also collected useful qualitative data that we'll refer to in the Act\n","Phase. We will compare their findings with our own from this Fitbit\n","dataset. The figure below summarizes their characterization of the\n","Novelty Effect, plus the factors that promote prolonged use of fitness\n","trackers.\n","\n","![](https://oup.silverchair-cdn.com/oup/backfile/Content_public/Journal/jamiaopen/2/1/10.1093_jamiaopen_ooy048/5/m_ooy048f3.jpeg?Expires=1646409016&Signature=yDYQnitJjrPUUjZhBpM1wT682xjeD0wdqKalULFpFRmdO7t7qVoo0ZRl1l~fkG4p79sozDAyjOPXOnwbMOHWdsSrB~wF-8GLDfxheZvj6DxWWYOrFCPQ4aKF9cgmJFGwbLH0VnocjX~gMWAkXpVroU8jBg-im0Mx277IZzV-tYwYCYHovNlVT5z2drc5B2hgTj2LdPHPXWind5EpltMyduorRzZrlycnIIkBqWJ~NU0q7RSrQBWk4r7vZyEvGs3WDhyaTT33y2h3ATwCtW2-MbJg2qfKxG109IM5OxovPVmGeinlTFHeCzJBcgiyplMrrVc5nrdP9S7GvEqa-RBk8w__&Key-Pair-Id=APKAIE5G5CRDK6RD3PGA)\n","\n","\n","\n","After learning about the Novelty Effect from Shin, et. al's data, I\n","decided it would be much more meaningful to try to detect any presence\n","of the Novelty effect within our own dataset. The theme of this analysis\n","is to look for whether there are patterns of initial high engagment and\n","use that gradually decline with time in a significant manner, even given\n","such a small window of time. The reasoning behind this is that if this\n","proves to be the case, then we would learn that we indeed have a\n","formidable challenge of customer retention and need to shift our focus\n","to the strategies that promote extended, better yet continuous use\n","beyond the early excitement phase. Moreover, Shin, et. al's authors\n","suggested in their findings that among the factors that promote\n","long-term sustained use are intrinsic, personal motivation to exercise.\n","We will look to see if our more active participants reflect this. That\n","will inform our high level suggestions in the conclusion. We will also\n","break down the pattern of use over the time period by usage frequency to\n","compare the general trends of high use to those of low use.\n","\n","In order to achieve that, our analysis will follow the following steps:\n","\n","1)Count the days of tracking activity by individual ID\n","\n","2)Assign activity level( Very Active, Moderately Active, and Inactive)\n","and usage frequency(high usage, low usage) level to each ID based on\n","activity tracking table.\n","\n","3)Obtain daily totals of tracking activity over the 31 days from all\n","participants who tracked.\n","\n","4)Break down the daily totals over the period by the activity levels.\n","This is so we can observe the general trend of use over the month by\n","activity level of participants. This is to differentiate the trends of\n","device use over the month for any feature of the app by customers who\n","are very active, moderately active, and inactive.\n","\n","5)Then, break down the daily totals by usage frequency levels. This is\n","so we can observe the general trend of use over the month by use\n","frequency of participants. This is intended for visualizing the trend of\n","use over time between the two groups, not their contribution to the\n","totals. Obviously the high use groups will contribute more to the total.\n","\n","We'll carry out these steps for the activity tracking table. Then we'll\n","use the activity levels and usage frequency assigned there to repeat\n","steps 1-5 to the tracking of:\n","\n","-heartrate\n","\n","-sleep\n","\n","-weight\n"]},{"cell_type":"code","execution_count":1,"id":"9a8fa1f5","metadata":{"execution":{"iopub.execute_input":"2022-02-23T21:46:22.383651Z","iopub.status.busy":"2022-02-23T21:46:22.380177Z","iopub.status.idle":"2022-02-23T21:46:55.822817Z","shell.execute_reply":"2022-02-23T21:46:55.821463Z"},"papermill":{"duration":33.740242,"end_time":"2022-02-23T21:46:55.823085","exception":false,"start_time":"2022-02-23T21:46:22.082843","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]}],"source":["###install tidyverse\n","install.packages(\"tidyverse\")\n","library(tidyverse)\n","#install skimr\n","install.packages(\"skimr\")\n","library(skimr)"]},{"cell_type":"code","execution_count":2,"id":"5546f2ba","metadata":{"execution":{"iopub.execute_input":"2022-02-23T21:46:56.484002Z","iopub.status.busy":"2022-02-23T21:46:56.425349Z","iopub.status.idle":"2022-02-23T21:46:56.551Z","shell.execute_reply":"2022-02-23T21:46:56.550238Z"},"papermill":{"duration":0.43007,"end_time":"2022-02-23T21:46:56.55116","exception":false,"start_time":"2022-02-23T21:46:56.12109","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 × 15</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>Id</th><th scope=col>ActivityDate</th><th scope=col>TotalSteps</th><th scope=col>TotalDistance</th><th scope=col>TrackerDistance</th><th 