ctive:21     1st Qu.: 67.742            High Usage:25    \n"," Very Active      : 5     Median : 96.774                             \n","                          Mean   : 84.360                             \n","                          3rd Qu.:100.000                             \n","                          Max.   :100.000                             "]},"metadata":{},"output_type":"display_data"}],"source":["#We use average daily steps as an approximate measure of the activity of the respondent. Using the numbers in the summary of dailyActivity Total Steps above, we will label the first quartile as Inactive, second and third quartile as Moderately Active, and the top quartile as Very Active.\n","###We will also categorize respondents into High Use and Low Use based on whether they are above or below the 67% threshold, respectively. We chose this level to compare what we found with the respondents in the Shin, et. al dataset.\n","\n","Tracking_Activity_Usage_Frequency <- dailyActivity%>%\n","        arrange(Id)%>%\n","        group_by(Id)%>%\n","        summarise(Average_Daily_Steps = mean(TotalSteps), Days_Tracked = n(), Activity_Level = factor(case_when(Average_Daily_Steps > 0 & Average_Daily_Steps < 4923 ~ \"Inactive\", Average_Daily_Steps >= 4923 & Average_Daily_Steps < 11092 ~ \"Moderately Active\", Average_Daily_Steps >= 11092 ~ \"Very Active\"), levels=c(\"Inactive\",\"Moderately Active\", \"Very Active\")),Percentage_of_Days_Tracked = Days_Tracked/31 * 100, Usage_Frequency = factor(case_when(Percentage_of_Days_Tracked <= 67 ~ \"Low Usage\", Percentage_of_Days_Tracked > 67 ~ \"High Usage\"), levels = c(\"Low Usage\", \"High Usage\")))\n","head(Tracking_Activity_Usage_Frequency)\n","summary(Tracking_Activity_Usage_Frequency)"]},{"cell_type":"code","execution_count":7,"id":"c2248cd8","metadata":{"execution":{"iopub.execute_input":"2022-02-23T21:47:00.168789Z","iopub.status.busy":"2022-02-23T21:47:00.166054Z","iopub.status.idle":"2022-02-23T21:47:00.188786Z"