ents are very active, meaning they took 11092 steps or\n","more on average daily.\n","\n","This pattern displays a distribution close to normal that is slightly\n","skewed to the right, having a little more inactive and moderately active\n","respondents.\n","\n"," \n","\n","Usage Frequency:\n","\n","From Figure 2: Distribution of Usage Frequency Among Respondents we see:\n","\n","Data shows that out of 33 participants, twenty-five  (76%) are high use,\n","in our case meaning that they tracked activity at least 67% of the 31\n","days of the period.\n","\n","Mean Usage was 84%.\n","\n"," About eleven (24%) are low use respondents who tracked activity less\n","than 67% of days.\n","\n","At first glance, this may sound positive. Figure 4 will add some insight\n","to show that most of the tracking happened in the earlier days of the\n","period, and gradually lessened as time progressed.\n","\n"," \n","\n","Activity and Usage Frequency relationship\n","\n","From Figure 3: Relationship between Activity Level and Usage Frequency\n","we can see the following:\n","\n","Inactive users: 57% are low Usage and 43% are high usage.\n","\n","Moderately active users: 19% are Low Usage and 81% are high usage.\n","\n","Very Active users: 100% are high usage\n","\n","This graph shows a clear positive correlation between the ordinal levels\n","of activity and usage frequency. Higher activity levels clearly\n","correspond to more frequent device usage.\n","\n"," \n","\n","Activity Tracking Over the 31 day Period\n","\n","Figure 4 : Total Daily Use Over Period is the most insightful graph in\n","this entire analysis. It shows the daily total number of people who\n","tracked for the duration of the period. The numbers start out very high,\n","as high as all of the 33 participants in one day and rapidly decline\n","with time to a low of only 17 out 33 using their device by the last day.\n","This is the central problem that this analysis is addressing. This\n","phenomenon clearly reflects the pattern of abandoning the use of\n","tracking device as time progresses very similar to the Novelty Effect,\n","and within a much shorter period. This parallels the findings in studies\n","quoted above in Phase 1 from other studies that found that half of\n","participants abandoned using their devices after only two weeks.\n","Remarkably, just under half (16 out of 33) of the clients in our own\n","Fitbit study stopped tracking activity by the end of the month. This\n","becomes especially clear when noticing that most of our respondents\n","exhibit high use. Clearly, most of this use came in the early days and\n","dwindled significantly with time."]},{"cell_type":"code","execution_count":77,"id":"8499cd58","metadata":{"execution":{"iopub.execute_input":"2022-02-23T21:50:28.962237Z","iopub.status.busy":"2022-02-23T21:50:28.960504Z","iopub.status.idle":"2022-02-23T21:50:29.37507Z","shell.execute_reply":"2022-02-23T21:50:29.374417Z"},"papermill":{"duration":1.059662,"end_time":"2022-02-23T21:50:29.375254","exception":false,"start_time":"2022-02-23T21:50:28.315592","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`geom_smooth()` using method = 'loess' and formula 'y ~ x'\n","\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AUZd4H8N8zM7ub3kNIQgkJqRB6Qi/SjmLBghUQ+51y9oLne3eeep7n2U/P\ncnYFQUE9QUCaNAHphJBQA4EQSO9td2ae94+NyWZ3k2ySzQ7ZfD//6D777MxvJs8mX2bmmWGc\ncwIAAACArk/QugAAAAAAcA4EOwAAAAA3gWAHAAAA4CYQ7AAAAADcBIIdAAAAgJtAsAMAAABw\nEwh2AAAAAG4CwQ4AAADATXS9YOclCqxFZQonov1PD2GMzdyaq3W9LrXnkeSWd47Z1YcLXFBM\n2j9TGGNT/nf28i/1k/hgxtjSgurmOmg3nJTty/9z743TY6Mi/Tz1/sE9E4aM/8Pil3acrXR5\nJfZFGCSrH5kgCN5+gQNGTn3m7ZV1zrv9uXN/BK/HBDLG1pTUNtfhj5G+jLFjNbJTVtccrlbF\neekZY4Ko31dpcsoy27qjOmNsV118hzHm4T/OicvsuJZ/IwG4DUnrAtqpV3R/j2ZCadfLqkRE\ntOmqqKmrs23bg+I+Ljp+h4ML8Qjp079/498qrladzrrImBQTE2XZLdwgOl4YV6t27jokGfqM\nHNHb8U+1qjNKdTM1l7bdOvvG7w/kEZEgefYIj1Qri44f3nH88I4PXvn73MUfLn3hpstktId