VORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["heartrate_tracking_over_month_by_usage_frequency_Long_Plot\n"]},{"cell_type":"markdown","id":"cebd4146","metadata":{"papermill":{"duration":0.683854,"end_time":"2022-02-23T21:51:00.999276","exception":false,"start_time":"2022-02-23T21:51:00.315422","status":"completed"},"tags":[]},"source":["Figure 15: Figure 15: Participants Who Tracked Heart Rate Over Period By\n","Usage Frequency shows the decline over the period in total usage by\n","activity. Low usage participants showed a clearly steeper decrease in\n","the number of daily people who tracked heartrate with the passage of\n","days in the period.\n","\n","Weight Log Info\n","\n","Only eight out of 33 participants (24%) tracked weight. Out of those\n","eight, only 3 used the feature to sync directly to Fitbit.com using a\n","connected scale. The rest of the visuals don't give any insight owing to\n","the small number of participants.\n","\n"," "]},{"cell_type":"markdown","id":"381f3c10","metadata":{"papermill":{"duration":0.684958,"end_time":"2022-02-23T21:51:02.374304","exception":false,"start_time":"2022-02-23T21:51:01.689346","status":"completed"},"tags":[]},"source":["Results from Shin, et. al's study.\n","\n","This study was attempting to address two main questions:  How does the\n","Novelty Effect manifest itself in the early stages of activity tracker\n","adoption and what factors motivate extended activity tracker use beyond\n","the novelty period? There were two distinct studies conducted to answer\n","the two questions above. A quantitative study observed patterns of use\n","of the Fitbit device over time to study the Novelty Effect, and a\n","qualitative study with questions and answers to study the factors that\n","motivate prolonged use beyond the Novelty Effect.\n","\n","The results of their quantitative study with 33 respondents showed that\n","mean usage was 76%. Compare that to our own result of the mean usage\n","being 84%. They observed their long term use. Then they divided them\n","into two groups: a high usage group (71%-100%) usage, and a low use group\n","(13%-67%). The results are summarized in the figure below.\n","![](https://oup.silverchair-cdn.com/oup/backfile/Content_public/Journal/jamiaopen/2/1/10.1093_jamiaopen_ooy048/5/m_ooy048f1.jpeg?Expires=1646409016&Signature=id2PxxfU8u99dsPRHOmgcdqP9KVu-G0bwZf4XaMxZkYclFT5d8nusKKC712~A6LoQXGq~xCvEsOVg9d26rLSw9YP~deuGJkhwmjwHPhzwpn9wQQj7SJZzZkP2M-ljKmQxGQKAtOlxw9xfdmHa-IjrJSu1EBwVICBVFXI0K4QKdna6AxSPIUTgNi-ELOia2A~V4m5kB4eKj6wtV18Oy6ArtaPAdII03-i67GnowBPg0ln9001hf-AlVjoj8hlvcLg4GS-HJqOvUxrIrhw-6JuVzW~oKvnvgog0jvEaFejiMr3Fkl~I3m5meGFoZdSUfZ0b1dVPBGwM4JbSr~QTfU-jg__&Key-Pair-Id=APKAIE5G5CRDK6RD3PGA)\n","\n","Based on these results, they inferred that the period of \"novelty\" is\n","approximately 3 months. We designed our own high use category to be\n","above 67% and low use below that to see if we can see similarities in\n","the use abandonment patterns within our much shorter time frame. This\n","graph illustrates our own result. It shows the overall curve decreasing\n","significantly, with a steeper curve for the low usage participants and a\n","flatter curve for the high  usage participants. This indicates overall\n","abandonment of product use that is mostly attributable to low frequency\n","users, just like the Shin et. al's research paper.\n","\n"," \n","\n"]},{"cell_type":"code","execution_count":88,"id":"1b4c7660","metadata":{"execution":{"iopub.execute_input":"2022-02-23T21:51:03.75243Z","iopub.status.busy":"2022-02-23T21:51:03.749341Z","iopub.status.idle":"2022-02-23T21:51:04.146968Z","shell.execute_reply":"2022-02-23T21:51:04.146199Z"},"papermill":{"duration":1.090039,"end_time":"2022-02-23T21:51:04.147132","exception":false,"start_time":"2022-02-23T21:51:03.057093","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`geom_smooth()` using method = 