\n","To summarize their findings\n","\n","Stage 1: Novelty Period\n","\n","\\- Motivational factors : curiosity about the data and curiosity  toward\n","the technology.\n","\n","\\- Inhibitors of Use beyond Novelty Period: loss of interest in knowing\n","repetitive patterns of behavior, loss of interest in the technical\n","features, and an inability to overcome their situational aspects, such\n","as time limitations\n","\n","Stage 2 Beyond the Novelty period:\n","\n","-Motivational factors:\n","\n","1)  Personal:\n","\n","-debilitating conditions like an arthritic hip that requires movement.\n","\n","-exercise being part of profession such as gymnastics instructor\n","\n","-intrinsic desire to exercise for all of the benefits\n","\n","2)Social:\n","\n","-relatedness: connectedness and camaraderie by sharing data and\n","experiences\n","\n","\\- Social Competition: for the competitive types competitions between\n","participants with ties in the social features of the app was a very\n","strong extrinsic motivator.\n","\n","3)Gamification: \"The use of video game elements to improve user\n","experience and user engagement in non-game services and applications.\"\n","\n","-Recognition: the badges and stars and the like are very good motivators\n","for people who like acknowledgment for their accomplishments.\n","\n","-Feedback: timely visual and textual feedback such as congratulations or\n","a flower that grows when you reach certain goals.\n","\n","-Goal Setting: respondents cited this as a source of motivation for\n","continuing to use the product.\n","\n","-This direct quote from the paper summarizes their conclusion:\n","\n","\"What causes positive changes in user behaviors (eg, more activity) is\n","therefore rooted in how strongly the device supports users' existing\n","personal and social context. If the user is lacking social or personal\n","motivation to increase daily physical activity levels, the device is not\n","likely to create such motivation (contrary to the promotional narrative\n","some vendors use), and users are likely to abandon the device after the\n","novelty effect wears off. \"(Shin et al)\n","\n"," ![Motivational Factors During Stages of Tracker\n","Use](https://oup.silverchair-cdn.com/oup/backfile/Content_public/Journal/jamiaopen/2/1/10.1093_jamiaopen_ooy048/5/m_ooy048f3.jpeg?Expires=1646409016&Signature=yDYQnitJjrPUUjZhBpM1wT682xjeD0wdqKalULFpFRmdO7t7qVoo0ZRl1l~fkG4p79sozDAyjOPXOnwbMOHWdsSrB~wF-8GLDfxheZvj6DxWWYOrFCPQ4aKF9cgmJFGwbLH0VnocjX~gMWAkXpVroU8jBg-im0Mx277IZzV-tYwYCYHovNlVT5z2drc5B2hgTj2LdPHPXWind5EpltMyduorRzZrlycnIIkBqWJ~NU0q7RSrQBWk4r7vZyEvGs3WDhyaTT33y2h3ATwCtW2-MbJg2qfKxG109IM5OxovPVmGeinlTFHeCzJBcgiyplMrrVc5nrdP9S7GvEqa-RBk8w__&Key-Pair-Id=APKAIE5G5CRDK6RD3PGA)\n"]},{"cell_type":"markdown","id":"a8ff393c","metadata":{"papermill":{"duration":0.697879,"end_time":"2022-02-23T21:51:09.763072","exception":false,"start_time":"2022-02-23T21:51:09.065193","status":"completed"},"tags":[]},"source":["Conclusion\n","\n","After analyzing the data and combining and comparing our dataset with\n","the Shin et al data and findings we arrive at the conclusions herein and\n","the following recommendations centered around the Bellabeat App, which\n","syncs to the other products such as Leaf, Time, Spring, and more\n","recently Ivy.\n","\n","Customers are initially excited about the tracking device and display a\n","lot of usage. In our dataset, customers showed the most interest in\n","tracking activity, followed by sleep, then heartrate, and very few\n","tracked weight. As time passes customers begin to abandon use of the\n","tracking device for a variety of reasons. Tracking total use over time\n","in our data illustrates an alarming trend of declining tracking, from\n","high use at the beginning of the period to about half of that at the end\n","of a very short period, across every one of the above-mentioned\n","categories. In every category (except weight tracking) very active and\n","high use clients exhibited the flattest curves, suggesting more\n","consistency and reliability. Inactive and low use clients consistently\n","showed significantly more decrease with time. Moderately active clients\n","were the majority and were responsible for most of the decrease, perhaps\n","suggesting a mixture of initial excitement and the onset of the factors\n","that eventually lead to significant non-use for the average user. This\n","looks like a foreshadowing of the Novelty Effect. Given more time, it's\n","likely that even more clients will mirror the behavior of Shin et al's\n","long term data. This is clearly not a desirable outcome for Bellabeat.\n","It is, therefore, important to enact strategies that keep the customers\n","continually using their products. The results we're aiming for are\n","better customer experience, satisfaction, and retention along with\n","increased revenue and revenue streams for the company. When customers\n","are engaged in the long term, they are much more likely to recommend the\n","product to others, and to purchase additional products offered by the\n","brand. Based on the data from these two sets we present the following\n","high level suggestions to the founders and the marketing team:\n","\n"," "]},{"cell_type":"markdown","id":"adaba858","metadata":{"papermill":{"duration":0.699578,"end_time":"2022-02-23T21:51:11.174528","exception":false,"start_time":"2022-02-23T21:51:10.47495","status":"completed"},"tags":[]},"source":["## Phase 6: Act\n"]},{"cell_type":"markdown","id":"fbdbf6d7","metadata":{"papermill":{"duration":0.701958,"end_time":"2022-02-23T21:51:12.592151","exception":false,"start_time":"2022-02-23T21:51:11.890193","status":"completed"},"tags":[]},"source":["High level recommendations for Bellabeat App:\n","\n","1)Introduce social features.\n","\n","Allow users to connect and share their data of feedback, recognition,\n","and those inspiring stories of struggle, transformation, and triumph.\n","This addresses the relatedness aspect of motivation. The sense of\n","community and bonding customers develop was one of the most powerful\n","motivators for long term use in Shin, et al's qualitative study.\n","\n","2)Differentiate brand using the social features.\n","\n","This ability to connect and bond with other like-minded women in order\n","to empower oneself to overcome barriers and achieve goals can be a\n","powerful branding theme for the marketing team. It is well known that\n","customers don't just buy products for their own sake, but rather for the\n","perceived utility, lifestyle and image that they impart. As we have\n","seen, the product by itself will not motivate consistency in health\n","habits, but when combined with community bonding, it will have a\n","powerful impact for a significant segment of the clientele.\n","\n","3)Introduce social competitions.\n","\n","Engage clients by offering all kinds of competitions. These can be\n","individuals competing, or teams competing. They can be short term\n","competitions or long term, beginner friendly or advanced, general\n","competitions tracking most steps, or specific activity competitions like\n","running. Among long term use research subjects in Shin et. al's research\n","competitions were cited as one of the primary reasons for prolonged\n","engagement with the app.\n","\n","4)Add gamification\n","\n","Gamification was also mentioned as one of the leading reasons people\n","continued to use their app. The added layer of fun and enjoyment works\n","for the participants. Add gamification to goal setting and to social\n","competitions to amplify those effects as well.\n","\n","5)Add variety and renewal to the user experience of goal setting and\n","feedback.\n","\n","The description of the app reflects that goal setting and feedback are\n","already part of the app. One of the inhibitors of use beyond the Novelty\n","Period was loss of interest in the technical features. It is, therefore,\n","important to keep the interface of goal setting and feedback interesting,\n","fresh, and frequently renewed so users don't get bored of the same\n","messaging over and over. This would be like how phone companies do with\n","their operating system and apps with updates that are not infrequent.\n","\n","6)  When targeting audience for advertising, target those with intrinsic\n","    motivation to exercise and maintain healthy habits, not those\n","    looking for something to motivate them to start.\n","\n","Data from both datasets clearly shows that more active users tend to\n","display higher use, and are more consistent with app engagment through\n","time. Qualitative analysis by Shin, et al. attributed this to intrinsic\n","motivation. So it's recommended to target people such as healthcare\n","professionals that might personally have interest in tracking health\n","habit data, like gymnastics instructors, physical therapists, and\n","personal trainers. It's also recommended to seek out people whose\n","intrinsic motivation is borne out of necessity such as pressing health\n","reasons, like the respondent who mentioned their arthritic hip, as they\n","are more likely to use and continue using fitness trackers. In addition,\n","if you can narrow targeting to women who are already very active, this\n","would be better because the data shows very active clients use the\n","tracking devices more frequently and for longer.\n","\n","7)  Monetize Competitions and Gamification.\n","\n","Going over the features of Beallabeat App on the website, and on Google\n","Play store and Apple's App store, it seems like the app does not support\n","social features, competitions, or gamification. These are among the most\n","prominent trends in the industry now, and not incorporating them may\n","lead to competitive disadvantage and possibly loss of market share. As a\n","suggestion, consider a small fee to enter into each social competition\n","that combines with gamification, goal setting, and rewards and feedback. This way\n","you turn your client base to a pool of potentially renewable income for\n","every gamified competition, instead of relying only on the occasional\n","periodic in-app purchases and the purchase of the tracker.\n","\n"," \n","\n","8)Fix basics.\n","\n","As of this writing the Bellabeat App has a rating of 2.7 out of 5 in the\n","Google Play store from a total of 3,074 reviews, which is dismal.\n","There's a wide range of reasons for this described in the reviews, much\n","of it owing to poor performance of basic functions according to the\n","reviewers. These are beyond the scope of this analysis and we won't\n","address them here. If the reviewers' complaints are accurate, then it is\n","highly recommended to fix these issues first as you can only build\n","social elements, competition, and gamification on top of a foundation\n","that is solid."]},{"cell_type":"markdown","id":"d1be6057","metadata":{"papermill":{"duration":0.693422,"end_time":"2022-02-23T21:51:13.991699","exception":false,"start_time":"2022-02-23T21:51:13.298277","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"b26d99c6","metadata":{"papermill":{"duration":0.706014,"end_time":"2022-02-23T21:51:15.392626","exception":false,"start_time":"2022-02-23T21:51:14.686612","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"faafb086","metadata":{"papermill":{"duration":0.697671,"end_time":"2022-02-23T21:51:16.784149","exception":false,"start_time":"2022-02-23T21:51:16.086478","status":"completed"},"tags":[]},"source":[]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":301.184613,"end_time":"2022-02-23T21:51:17.693436","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-02-23T21:46:16.508823","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}